(9, 1, '2022-09-22 18:01:21', '2022-09-22 18:01:21', '<!-- wp:template-part {\"slug\":\"header\",\"theme\":\"bjork\",\"tagName\":\"header\",\"className\":\"site-header\"} /-->\n\n<!-- wp:group {\"layout\":{\"inherit\":true}} -->\n<div class=\"wp-block-group\"><!-- wp:columns {\"align\":\"wide\",\"style\":{\"spacing\":{\"margin\":{\"bottom\":\"0px\"}}}} -->\n<div class=\"wp-block-columns alignwide\" style=\"margin-bottom:0px\"><!-- wp:column {\"width\":\"23%\",\"className\":\"site-sidebar-col\"} -->\n<div class=\"wp-block-column site-sidebar-col\" style=\"flex-basis:23%\"><!-- wp:template-part {\"slug\":\"sidebar\",\"theme\":\"bjork\",\"tagName\":\"aside\",\"className\":\"site-sidebar\"} /--></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"77%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:77%\"><!-- wp:group {\"tagName\":\"main\",\"layout\":{\"inherit\":true}} -->\n<main class=\"wp-block-group\"><!-- wp:cover {\"useFeaturedImage\":true,\"dimRatio\":0,\"overlayColor\":\"quaternary\",\"minHeight\":90,\"minHeightUnit\":\"vh\",\"isDark\":false,\"align\":\"wide\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"0vh\",\"right\":\"0vh\",\"bottom\":\"0vh\",\"left\":\"0vh\"}}}} -->\n<div class=\"wp-block-cover alignwide is-light\" style=\"padding-top:0vh;padding-right:0vh;padding-bottom:0vh;padding-left:0vh;min-height:90vh\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-quaternary-background-color has-background-dim-0 has-background-dim\"></span><div class=\"wp-block-cover__inner-container\"><!-- wp:group {\"align\":\"wide\",\"style\":{\"spacing\":{\"padding\":{\"bottom\":\"0vh\",\"top\":\"0vh\"},\"blockGap\":\"2rem\"}},\"textColor\":\"foreground\"} -->\n<div class=\"wp-block-group alignwide has-foreground-color has-text-color\" style=\"padding-top:0vh;padding-bottom:0vh\"><!-- wp:heading {\"level\":1,\"style\":{\"spacing\":{\"margin\":{\"top\":\"0px\"}}},\"textColor\":\"secondary\",\"fontSize\":\"extra-large\"} -->\n<h1 class=\"has-secondary-color has-text-color has-extra-large-font-size\" style=\"margin-top:0px\">Hi there!\n			</h1>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>My name is Björk, and I am a podcaster and writer. This is my little corner on the web.</h1>\n<!-- /wp:heading -->\n\n<!-- wp:buttons {\"style\":{\"spacing\":{\"blockGap\":\"1em\"}}} -->\n<div class=\"wp-block-buttons\"><!-- wp:button {\"style\":{\"color\":{}}} -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link\">Get In Touch</a></div>\n<!-- /wp:button -->\n\n<!-- wp:button {\"textColor\":\"primary\",\"className\":\"is-style-outline\"} -->\n<div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link has-primary-color has-text-color\">About Me</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:group --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:separator {\"backgroundColor\":\"tertiary\",\"className\":\"is-style-bjork-angled-separator-wide\"} -->\n<hr class=\"wp-block-separator has-text-color has-tertiary-color has-alpha-channel-opacity has-tertiary-background-color has-background is-style-bjork-angled-separator-wide\"/>\n<!-- /wp:separator -->\n\n<!-- wp:columns {\"align\":\"wide\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"5vh\",\"bottom\":\"5vh\"}}}} -->\n<div class=\"wp-block-columns alignwide\" style=\"padding-top:5vh;padding-bottom:5vh\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et\n			dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex\n			ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"style\":{\"spacing\":{\"blockGap\":\"1em\"}}} -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Sed ut perspiciatis unde omnis is