(16, 1, '2022-09-26 17:15:55', '2022-09-26 17:15:55', '<!-- wp:group -->\n<div class=\"wp-block-group\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"76%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:76%\"><!-- wp:heading -->\n<h2>WHAT I DO</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>William Ford Gibson</strong> (born March 17, 1948) is an American-Canadian speculative fiction writer and essayist widely credited with pioneering the science fiction subgenre known as cyberpunk. Beginning his writing career in the late 1970s.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>His early works were noir, near-future stories that explored the effects of technology, cybernetics, and computer networks on humans—a \"combination of lowlife and high tech.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link\" href=\"https://cbarnett4.bitlampsites.com/wpd/final/bio/\">LEARN MORE</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"24%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:24%\"><!-- wp:image {\"align\":\"left\",\"id\":308,\"width\":202,\"height\":295,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image alignleft size-large is-resized\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/1518082872-william-gibson_6C9Gh-701x1024.jpg\" alt=\"\" class=\"wp-image-308\" width=\"202\" height=\"295\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:cover {\"customOverlayColor\":\"#613f75\"} -->\n<div class=\"wp-block-cover\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-background-dim-100 has-background-dim\" style=\"background-color:#613f75\"></span><div class=\"wp-block-cover__inner-container\"><!-- wp:heading {\"fontSize\":\"large\"} -->\n<h2 class=\"has-large-font-size\">TOP BOOKS</h2>\n<!-- /wp:heading -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":291,\"sizeSlug\":\"large\",\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image size-large\"><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/burning-chrome/\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/burning.webp\" alt=\"\" class=\"wp-image-291\"/></a><figcaption><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/burning-chrome/\" data-type=\"book\" data-id=\"290\">Burning Chrome</a></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":284,\"sizeSlug\":\"large\",\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image size-large\"><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/count-zero/\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/22.webp\" alt=\"\" class=\"wp-image-284\"/></a><figcaption><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/count-zero/\" data-type=\"book\" data-id=\"160\">Count Zero</a></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":289,\"sizeSlug\":\"large\",\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image size-large\"><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/the-gernsback-continuum/\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/peripheral.webp\" alt=\"\" class=\"wp-image-289\"/></a><figcaption><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/the-gernsback-continuum/\" data-type=\"book\" data-id=\"157\">The Peripheral</a></figcaption></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:spacer {\"height\":\"10px\"} -->\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:buttons {\"layout\":{\"type\":\"flex\",\"justifyContent\":\"left\",\"orientation\":\"horizontal\"}} -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link\" href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/\">VIEW ALL</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:media-text {\"align\":\"\",\"mediaId\":279,\"mediaLink\":\"https://cbarnett4.bitlampsites.com/wpd/final/home/william_gibson_and_cory_doctorow/\",\"mediaType\":\"image\",\"mediaWidth\":38,\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-media-text is-stacked-on-mobile is-vertically-aligned-center\" style=\"grid-template-columns:38% auto\"><figure class=\"wp-block-media-text__media\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/William_Gibson_and_Cory_Doctorow.jpg\" alt=\"\" class=\"wp-image-279 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>CULTURAL SIGNIFICANCE</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>In his early short fiction, Gibson is credited by Rapatzikou in <em>The Literary Encyclopedia</em> with effectively \"renovating\" science fiction, a genre at that time considered widely \"insignificant\", influencing by means of the postmodern aesthetic of his writing the development of new perspectives in science fiction studies. In the words of filmmaker Marianne Trench, Gibson\'s visions \"struck sparks in the real world\" and \"determined the way people thought and talked\" to an extent unprecedented in science fiction literature.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-mystic-131\"> </a></sup>The publication of <em><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/neuromancer/\" data-type=\"book\" data-id=\"164\">Neuromancer</a></em> (1984) hit a cultural nerve, causing Larry McCaffery to credit Gibson with virtually launching the cyberpunk movements.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->', 'WILLIAM GIBSON', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2022-10-05 15:46:54', '2022-10-05 15:46:54', '', 0, 'https://cbarnett4.bitlampsites.com/wpd/final/?page_id=16', 0, 'page', '', 0),
