(157, 1, '2022-09-29 23:05:53', '2022-09-29 23:05:53', '<!-- wp:paragraph -->\n<p>Flynne Fisher lives down a country road, in a rural America where jobs are scarce, unless you count illegal drug manufacture, which she’s trying to avoid. Her brother Burton lives on money from the Veterans Administration, for neurological damage suffered in the Marines’ elite Haptic Recon unit. Flynne earns what she can by assembling product at the local 3D printshop. She made more as a combat scout in an online game, playing for a rich man, but she’s had to let the shooter games go.</p>\n<!-- /wp:paragraph -->', 'The Peripheral', '', 'publish', 'closed', 'closed', '', 'the-gernsback-continuum', '', '', '2022-10-03 15:46:37', '2022-10-03 15:46:37', '', 0, 'https://cbarnett4.bitlampsites.com/wpd/final/?post_type=book&#038;p=157', 0, 'book', '', 0),
(158, 1, '2022-09-29 23:05:41', '2022-09-29 23:05:41', '', '0_JA3vtejGWw5jKsw0', '', 'inherit', 'open', 'closed', '', '0_ja3vtejgww5jksw0', '', '', '2022-09-29 23:05:47', '2022-09-29 23:05:47', '', 157, 'https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/0_JA3vtejGWw5jKsw0.jpeg', 0, 'attachment', 'image/jpeg', 0),
(160, 1, '2022-09-29 23:13:41', '2022-09-29 23:13:41', '<!-- wp:paragraph -->\n<p>Turner, corporate mercenary, wakes in a reconstructed body, a beautiful woman by his side. Then Hosaka Corporation reactivates him for a mission more dangerous than the one he\'s recovering from: Maas-Neotek\'s chief of R&amp;D is defecting. Turner is the one assigned to get him out intact, along with the biochip he\'s perfected. But this proves to be of supreme interest to certain&nbsp;<em>other</em>&nbsp;parties--some of whom aren\'t remotely human.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Bobby Newmark is entirely human: a rustbelt data-hustler totally unprepared for what comes his way when the defection triggers war in cyberspace. With voodoo on the Net and a price on his head, Newmark thinks he\'s only trying to get out alive. A stylish, streetsmart, frighteningly probable parable of the future and sequel to&nbsp;<em><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/neuromancer/\" data-type=\"book\" data-id=\"164\">Neuromancer</a></em></p>\n<!-- /wp:paragraph -->', 'Count Zero', '', 'publish', 'closed', 'closed', '', 'count-zero', '', '', '2022-10-03 15:39:38', '2022-10-03 15:39:38', '', 0, 'https://cbarnett4.bitlampsites.com/wpd/final/?post_type=book&#038;p=160', 0, 'book', '', 0),
