(162, 1, '2022-09-29 23:17:07', '2022-09-29 23:17:07', '<!-- wp:paragraph -->\n<p>Mona Lisa Overdrive is a science fiction novel by American-Canadian writer William Gibson, published in 1988. It is the final novel of the cyberpunk Sprawl trilogy, following Neuromancer and Count Zero, taking place eight years after the events of the latter.</p>\n<!-- /wp:paragraph -->', 'Mona Lisa Overdrive', '', 'publish', 'closed', 'closed', '', 'mona-lisa-overdrive', '', '', '2022-10-03 15:42:50', '2022-10-03 15:42:50', '', 0, 'https://cbarnett4.bitlampsites.com/wpd/final/?post_type=book&#038;p=162', 0, 'book', '', 0),
