(164, 1, '2022-09-29 23:21:06', '2022-09-29 23:21:06', '<!-- wp:paragraph -->\n<p>Neuromancer is a 1984 science fiction novel by American-Canadian writer William Gibson. Considered one of the earliest and best-known works in the cyberpunk genre, it is the only novel to win the Nebula Award, the Philip K. Dick Award, and the Hugo Award.</p>\n<!-- /wp:paragraph -->', 'Neuromancer', '', 'publish', 'closed', 'closed', '', 'neuromancer', '', '', '2022-10-03 15:40:02', '2022-10-03 15:40:02', '', 0, 'https://cbarnett4.bitlampsites.com/wpd/final/?post_type=book&#038;p=164', 0, 'book', '', 0),
