c=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/51uNB8reIjL-1.jpeg\" data-object-fit=\"cover\"/><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\"></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->', 'WILLIAM GIBSON', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2022-10-02 00:20:01', '2022-10-02 00:20:01', '', 16, 'https://cbarnett4.bitlampsites.com/wpd/final/?p=258', 0, 'revision', '', 0),
