(263, 1, '2022-10-02 02:59:34', '2022-10-02 02:59:34', '<!-- wp:media-text {\"align\":\"\",\"mediaPosition\":\"right\",\"mediaId\":261,\"mediaLink\":\"https://cbarnett4.bitlampsites.com/wpd/final/bio/william/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/william-1024x781.jpeg\" alt=\"\" class=\"wp-image-261 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>WHO AM I?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>William Ford Gibson</strong> (born March 17, 1948) is an American-Canadian <a href=\"https://en.wikipedia.org/wiki/Speculative_fiction\">speculative fiction</a> writer and essayist widely credited with pioneering the <a href=\"https://en.wikipedia.org/wiki/Science_fiction\">science fiction</a> subgenre known as <em><a href=\"https://en.wikipedia.org/wiki/Cyberpunk\">cyberpunk</a></em>. Beginning his writing career in the late 1970s, his early works were <a href=\"https://en.wikipedia.org/wiki/Noir_fiction\">noir</a>, near-future stories that explored the effects of <a href=\"https://en.wikipedia.org/wiki/Technology\">technology</a>, <a href=\"https://en.wikipedia.org/wiki/Cybernetics\">cybernetics</a>, and <a href=\"https://en.wikipedia.org/wiki/Computer_network\">computer networks</a> on humans—a \"combination of <a href=\"https://en.wikipedia.org/wiki/Low-life\">lowlife</a> and <a href=\"https://en.wikipedia.org/wiki/High_tech\">high tech</a>\"<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-mao2-4\">[4]</a></sup>—and helped to create an <a href=\"https://en.wikipedia.org/wiki/Iconography\">iconography</a> for the <a href=\"https://en.wikipedia.org/wiki/Information_age\">information age</a> before the ubiquity of the Internet in the 1990s.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-5\">[5]</a></sup> Gibson coined the term \"<a href=\"https://en.wikipedia.org/wiki/Cyberspace\">cyberspace</a>\" for \"widespread, interconnected digital technology\" in his short story \"<a href=\"https://en.wikipedia.org/wiki/Burning_Chrome\">Burning Chrome</a>\" (1982), and later popularized the concept in his acclaimed debut novel <em><a href=\"https://en.wikipedia.org/wiki/Neuromancer\">Neuromancer</a></em> (1984). These early works of Gibson\'s have been credited with \"renovating\" science fiction literature in the 1980s.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>After expanding on the story in <em>Neuromancer</em> with two more novels (<em><a href=\"https://en.wikipedia.org/wiki/Count_Zero\">Count Zero</a></em> in 1986, and <em><a href=\"https://en.wikipedia.org/wiki/Mona_Lisa_Overdrive\">Mona Lisa Overdrive</a></em> in 1988), thus completing the <a href=\"https://en.wikipedia.org/wiki/Dystopic\">dystopic</a> <a href=\"https://en.wikipedia.org/wiki/Sprawl_trilogy\"><em>Sprawl</em> trilogy</a>, Gibson collaborated with <a href=\"https://en.wikipedia.org/wiki/Bruce_Sterling\">Bruce Sterling</a> on the <a href=\"https://en.wikipedia.org/wiki/Alternate_history\">alternate history</a> novel <em><a href=\"https://en.wikipedia.org/wiki/The_Difference_Engine\">The Difference Engine</a></em> (1990), which became an important work of the science fiction subgenre known as <em><a href=\"https://en.wikipedia.org/wiki/Steampunk\">steampunk</a></em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In the 1990s, Gibson composed the <a href=\"https://en.wikipedia.org/wiki/Bridge_trilogy\"><em>Bridge</em> trilogy</a> of novels, which explored the <a href=\"https://en.wikipedia.org/wiki/Sociological\">sociological</a> developments of near-future urban environments, <a href=\"https://en.wikipedia.org/wiki/Postindustrial_society\">postindustrial society</a>, and <a href=\"https://en.wikipedia.org/wiki/Late_capitalism\">late capitalism</a>. Following the turn of the century and the events of <a href=\"https://en.wikipedia.org/wiki/September_11_attacks\">9/11</a>, Gibson emerged with a string of increasingly <a href=\"https://en.wikipedia.org/wiki/Literary_realism\">realist</a> novels—<em><a href=\"https://en.wikipedia.org/wiki/Pattern_Recognition_(novel)\">Pattern Recognition</a></em> (2003), <em><a href=\"https://en.wikipedia.org/wiki/Spook_Country\">Spook Country</a></em> (2007), and <em><a href=\"https://en.wikipedia.org/wiki/Zero_History\">Zero History</a></em> (2010)—set in a roughly contemporary world. These works saw his name reach mainstream <a href=\"https://en.wikipedia.org/wiki/Bestseller\">bestseller lists</a> for the first time. His most recent novels, <em><a href=\"https://en.wikipedia.org/wiki/The_Peripheral\">The Peripheral</a></em> (2014) and <a href=\"https://en.wikipedia.org/wiki/Agency_(novel)\"><em>Agency</em></a> (2020), returned to a more overt engagement with technology and recognizable science fiction themes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In 1999, <em><a href=\"https://en.wikipedia.org/wiki/The_Guardian\">The Guardian</a></em> described Gibson as \"probably the most important novelist of the past two decades\", while <em><a href=\"https://en.wikipedia.org/wiki/The_Sydney_Morning_Herald\">The Sydney Morning Herald</a></em> called him the \"noir prophet\" of cyberpunk.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-smh2-6\">[6]</a></sup> Throughout his career, Gibson has written more than 20 short stories and 12 critically acclaimed novels (one in collaboration), contributed articles to several major publications, and collaborated extensively with performance artists, filmmakers, and musicians. His work has been cited as influencing a variety of disciplines: academia, design, film, literature, music, <a href=\"https://en.wikipedia.org/wiki/Cyberculture\">cyberculture</a>, and technology.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->', 'BIO', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2022-10-02 02:59:34', '2022-10-02 02:59:34', '', 12, 'https://cbarnett4.bitlampsites.com/wpd/final/?p=263', 0, 'revision', '', 0),
