n.wikipedia.org/wiki/Late_capitalism\">late capitalism</a>. Following the turn of the century and the events of <a href=\"https://en.wikipedia.org/wiki/September_11_attacks\">9/11</a>, Gibson emerged with a string of increasingly <a href=\"https://en.wikipedia.org/wiki/Literary_realism\">realist</a> novels—<em><a href=\"https://en.wikipedia.org/wiki/Pattern_Recognition_(novel)\">Pattern Recognition</a></em> (2003), <em><a href=\"https://en.wikipedia.org/wiki/Spook_Country\">Spook Country</a></em> (2007), and <em><a href=\"https://en.wikipedia.org/wiki/Zero_History\">Zero History</a></em> (2010)—set in a roughly contemporary world. These works saw his name reach mainstream <a href=\"https://en.wikipedia.org/wiki/Bestseller\">bestseller lists</a> for the first time. His most recent novels, <em><a href=\"https://en.wikipedia.org/wiki/The_Peripheral\">The Peripheral</a></em> (2014) and <a href=\"https://en.wikipedia.org/wiki/Agency_(novel)\"><em>Agency</em></a> (2020), returned to a more overt engagement with technology and recognizable science fiction themes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In 1999, <em><a href=\"https://en.wikipedia.org/wiki/The_Guardian\">The Guardian</a></em> described Gibson as \"probably the most important novelist of the past two decades\", while <em><a href=\"https://en.wikipedia.org/wiki/The_Sydney_Morning_Herald\">The Sydney Morning Herald</a></em> called him the \"noir prophet\" of cyberpunk.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-smh2-6\">[6]</a></sup> Throughout his career, Gibson has written more than 20 short stories and 12 critically acclaimed novels (one in collaboration), contributed articles to several major publications, and collaborated extensively with performance artists, filmmakers, and musicians. His work has been cited as influencing a variety of disciplines: academia, design, film, literature, music, <a href=\"https://en.wikipedia.org/wiki/Cyberculture\">cyberculture</a>, and technology.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->', 'BIO', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2022-10-02 03:00:14', '2022-10-02 03:00:14', '', 12, 'https://cbarnett4.bitlampsites.com/wpd/final/?p=264', 0, 'revision', '', 0),
