(272, 1, '2022-10-03 14:56:44', '2022-10-03 14:56:44', '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"66.66%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:66.66%\"><!-- wp:heading -->\n<h2>WHO AM I?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>William Ford Gibson</strong> (born March 17, 1948) is an American-Canadian speculative fiction writer and essayist widely credited with pioneering the science fiction subgenre known as <em>cyberpunk</em>. Beginning his writing career in the late 1970s, his early works were noir, near-future stories that explored the effects of technology, cybernetics, and computer networks on humans—a \"combination of lowlife and high tech\"<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-mao2-4\">[4]</a></sup>—and helped to create an iconography for the information age before the ubiquity of the Internet in the 1990s.<sup>[5]</sup> Gibson coined the term \"cyberspace\" for \"widespread, interconnected digital technology\" in his short story \"Burning Chrome\" (1982), and later popularized the concept in his acclaimed debut novel<a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/neuromancer/\" data-type=\"book\" data-id=\"164\"> Neuromancer</a> (1984). These early works of Gibson\'s have been credited with \"renovating\" science fiction literature in the 1980s.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>After expanding on the story in <em>Neuromancer</em> with two more novels (<em><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/count-zero/\" data-type=\"book\" data-id=\"160\">Count Zero</a></em> in 1986, and <em><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/mona-lisa-overdrive/\" data-type=\"book\" data-id=\"162\">Mona Lisa Overdrive</a></em> in 1988), thus completing the dystopic <em>Sprawl</em> trilogy, Gibson collaborated with Bruce Sterling on the alternate history novel <em>The Difference Engine</em> (1990), which became an important work of the science fiction subgenre known as <em>steampunk</em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In the 1990s, Gibson composed the <em>Bridge</em> trilogy of novels, which explored the sociological developments of near-future urban environments, postindustrial society, and late capitalism. Following the turn of the century and the events of 9/11, Gibson emerged with a string of increasingly realist novels—<em>Pattern Recognition</em> (2003), <em>Spook Country</em> (2007), and <em>Zero History</em> (2010)—set in a roughly contemporary world. These works saw his name reach mainstream bestseller lists for the first time. His most recent novels, <em>The Peripheral</em> (2014) and <em>Agency</em> (2020), returned to a more overt engagement with technology and recognizable science fiction themes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In 1999, <em><a href=\"https://en.wikipedia.org/wiki/The_Guardian\">The Guardian</a></em> described Gibson as \"probably the most important novelist of the past two decades\", while <em>The Sydney Morning Herald</em> called him the \"noir prophet\" of cyberpunk.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-smh2-6\">[6]</a></sup> Throughout his career, Gibson has written more than 20 short stories and 12 critically acclaimed novels (one in collaboration), contributed articles to several major publications, and collaborated extensively with performance artists, filmmakers, and musicians. His work has been cited as influencing a variety of disciplines: academia, design, film, literature, music, cyberculture, and technology.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"33.33%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:33.33%\"><!-- wp:image {\"id\":268,\"width\":268,\"height\":204,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/william-1-1024x781.jpeg\" alt=\"\" class=\"wp-image-268\" width=\"268\" height=\"204\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'BIO', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2022-10-03 14:56:44', '2022-10-03 14:56:44', '', 12, 'https://cbarnett4.bitlampsites.com/wpd/final/?p=272', 0, 'revision', '', 0),
