mg src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/william-1-1024x781.jpeg\" alt=\"\" class=\"wp-image-268\" width=\"268\" height=\"204\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'BIO', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2022-10-03 15:04:26', '2022-10-03 15:04:26', '', 12, 'https://cbarnett4.bitlampsites.com/wpd/final/?p=274', 0, 'revision', '', 0);
