(280, 1, '2022-10-03 15:32:24', '2022-10-03 15:32:24', '<!-- wp:group -->\n<div class=\"wp-block-group\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"76%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:76%\"><!-- wp:heading {\"level\":1} -->\n<h1>WHO IS HE?</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>William Ford Gibson</strong> (born March 17, 1948) is an American-Canadian speculative<a href=\"https://en.wikipedia.org/wiki/Speculative_fiction\"> </a>fiction writer and essayist widely credited with pioneering the science fiction subgenre known as cyberpunk. Beginning his writing career in the late 1970s.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link\" href=\"https://cbarnett4.bitlampsites.com/wpd/final/bio/\">LEARN MORE</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"24%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:24%\"><!-- wp:image {\"align\":\"left\",\"id\":224,\"width\":187,\"height\":280} -->\n<figure class=\"wp-block-image alignleft is-resized\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/51OATljr5VL._SX331_BO1204203200_-3.jpg\" alt=\"\" class=\"wp-image-224\" width=\"187\" height=\"280\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"backgroundColor\":\"vivid-green-cyan\"} -->\n<div class=\"wp-block-columns has-vivid-green-cyan-background-color has-background\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:cover {\"url\":\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/cropped-51OATljr5VL._SX331_BO1204203200_-3.jpg\",\"id\":227,\"dimRatio\":50,\"isDark\":false} -->\n<div class=\"wp-block-cover is-light\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-background-dim\"></span><img class=\"wp-block-cover__image-background wp-image-227\" alt=\"\" src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/cropped-51OATljr5VL._SX331_BO1204203200_-3.jpg\" data-object-fit=\"cover\"/><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2></h2>\n<!-- /wp:heading --></div></div>\n<!-- /wp:cover --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:cover {\"url\":\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/510HUEDkyL._SY344_BO1204203200_-2.jpg\",\"id\":213,\"dimRatio\":50,\"style\":{\"color\":{}}} -->\n<div class=\"wp-block-cover\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-background-dim\"></span><img class=\"wp-block-cover__image-background wp-image-213\" alt=\"\" src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/510HUEDkyL._SY344_BO1204203200_-2.jpg\" data-object-fit=\"cover\"/><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\"></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:cover {\"url\":\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/51uNB8reIjL-1.jpeg\",\"id\":214,\"dimRatio\":50} -->\n<div class=\"wp-block-cover\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-background-dim\"></span><img class=\"wp-block-cover__image-background wp-image-214\" alt=\"\" src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/51uNB8reIjL-1.jpeg\" data-object-fit=\"cover\"/><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\"></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:media-text {\"mediaId\":279,\"mediaLink\":\"https://cbarnett4.bitlampsites.com/wpd/final/home/william_gibson_and_cory_doctorow/\",\"mediaType\":\"image\",\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile is-vertically-aligned-center\"><figure class=\"wp-block-media-text__media\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/William_Gibson_and_Cory_Doctorow.jpg\" alt=\"\" class=\"wp-image-279 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>CULTURAL SIGNIFICANCE</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>In his early short fiction, Gibson is credited by Rapatzikou in <em>The Literary Encyclopedia</em> with effectively \"renovating\" science fiction, a genre at that time considered widely \"insignificant\",<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-litencyc-9\">[9]</a></sup> influencing by means of the postmodern aesthetic of his writing the development of new perspectives in <a href=\"https://en.wikipedia.org/wiki/Science_fiction_studies\">science fiction studies</a>.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-hollinger-38\">[37]</a></sup> In the words of filmmaker Marianne Trench, Gibson\'s visions \"struck sparks in the real world\" and \"determined the way people thought and talked\" to an extent unprecedented in science fiction literature.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-mystic-131\">[130]</a></sup> The publication of <em>Neuromancer</em> (1984) hit a cultural nerve,<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-hollinger-38\">[37]</a></sup> causing <a href=\"https://en.wikipedia.org/wiki/Larry_McCaffery\">Larry McCaffery</a> to credit Gibson with virtually launching the <a href=\"https://en.wikipedia.org/wiki/Cyberpunk\">cyberpunk</a> movement,<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-project_cyberpunk_interview-17\">[16]</a></sup> as \"the one major writer who is original and gifted to make the whole movement seem original and gifted.\"<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-storming-31\">[30]</a></sup><sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-1962_Internet-132\">[b]</a></sup> Aside from their central importance to cyberpunk and <a href=\"https://en.wikipedia.org/wiki/Steampunk\">steampunk</a> fiction, Gibson\'s fictional works have been hailed by space historian <a href=\"https://en.wikipedia.org/wiki/Dwayne_A._Day\">Dwayne A. Day</a> as some of the best examples of <a href=\"https://en.wikipedia.org/wiki/Outer_space\">space-based</a> science fiction (or \"solar sci-fi\"), and \"probably the only ones that rise above mere escapism to be truly thought-provoking\".</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->', 'WILLIAM GIBSON', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2022-10-03 15:32:24', '2022-10-03 15:32:24', '', 16, 'https://cbarnett4.bitlampsites.com/wpd/final/?p=280', 0, 'revision', '', 0),
(281, 1, '2022-10-03 15:32:43', '2022-10-03 15:32:43', '<!-- wp:group -->\n<div class=\"wp-block-group\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"76%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:76%\"><!-- wp:heading {\"level\":1} -->\n<h1>WHO IS HE?</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>William Ford Gibson</strong> (born March 17, 1948) is an American-Canadian speculative<a href=\"https://en.wikipedia.org/wiki/Speculative_fiction\"> </a>fiction writer and essayist widely credited with pioneering the science fiction subgenre known as cyberpunk. Beginning his writing career in the late 1970s.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link\" href=\"https://cbarnett4.bitlampsites.com/wpd/final/bio/\">LEARN MORE</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"24%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:24%\"><!-- wp:image {\"align\":\"left\",\"id\":224,\"width\":187,\"height\":280} -->\n<figure class=\"wp-block-image alignleft is-resized\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/51OATljr5VL._SX331_BO1204203200_-3.jpg\" alt=\"\" class=\"wp-image-224\" width=\"187\" height=\"280\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"backgroundColor\":\"vivid-green-cyan\"} -->\n<div class=\"wp-block-columns has-vivid-green-cyan-background-color has-background\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:cover {\"url\":\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/cropped-51OATljr5VL._SX331_BO1204203200_-3.jpg\",\"id\":227,\"dimRatio\":50,\"isDark\":false} -->\n<div class=\"wp-block-cover is-light\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-background-dim\"></span><img class=\"wp-block-cover__image-background wp-image-227\" alt=\"\" src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/cropped-51OATljr5VL._SX331_BO1204203200_-3.jpg\" data-object-fit=\"cover\"/><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2></h2>\n<!-- /wp:heading --></div></div>\n<!-- /wp:cover --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:cover {\"url\":\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/510HUEDkyL._SY344_BO1204203200_-2.jpg\",\"id\":213,\"dimRatio\":50,\"style\":{\"color\":{}}} -->\n<div class=\"wp-block-cover\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-background-dim\"></span><img class=\"wp-block-cover__image-background wp-image-213\" alt=\"\" src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/510HUEDkyL._SY344_BO1204203200_-2.jpg\" data-object-fit=\"cover\"/><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\"></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:cover {\"url\":\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/51uNB8reIjL-1.jpeg\",\"id\":214,\"dimRatio\":50} -->\n<div class=\"wp-block-cover\"><span aria-hidden=\"true\" class=\"wp-block-cover__background has-background-dim\"></span><img class=\"wp-block-cover__image-background wp-image-214\" alt=\"\" src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/51uNB8reIjL-1.jpeg\" data-object-fit=\"cover\"/><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\"></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:media-text {\"align\":\"\",\"mediaId\":279,\"mediaLink\":\"https://cbarnett4.bitlampsites.com/wpd/final/home/william_gibson_and_cory_doctorow/\",\"mediaType\":\"image\",\"verticalAlignment\":\"top\"} -->\n<div class=\"wp-block-media-text is-stacked-on-mobile is-vertically-aligned-top\"><figure class=\"wp-block-media-text__media\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/William_Gibson_and_Cory_Doctorow.jpg\" alt=\"\" class=\"wp-image-279 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>CULTURAL SIGNIFICANCE</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>In his early short fiction, Gibson is credited by Rapatzikou in <em>The Literary Encyclopedia</em> with effectively \"renovating\" science fiction, a genre at that time considered widely \"insignificant\",<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-litencyc-9\">[9]</a></sup> influencing by means of the postmodern aesthetic of his writing the development of new perspectives in <a href=\"https://en.wikipedia.org/wiki/Science_fiction_studies\">science fiction studies</a>.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-hollinger-38\">[37]</a></sup> In the words of filmmaker Marianne Trench, Gibson\'s visions \"struck sparks in the real world\" and \"determined the way people thought and talked\" to an extent unprecedented in science fiction literature.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-mystic-131\">[130]</a></sup> The publication of <em>Neuromancer</em> (1984) hit a cultural nerve,<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-hollinger-38\">[37]</a></sup> causing <a href=\"https://en.wikipedia.org/wiki/Larry_McCaffery\">Larry McCaffery</a> to credit Gibson with virtually launching the <a href=\"https://en.wikipedia.org/wiki/Cyberpunk\">cyberpunk</a> movement,<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-project_cyberpunk_interview-17\">[16]</a></sup> as \"the one major writer who is original and gifted to make the whole movement seem original and gifted.\"<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-storming-31\">[30]</a></sup><sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-1962_Internet-132\">[b]</a></sup> Aside from their central importance to cyberpunk and <a href=\"https://en.wikipedia.org/wiki/Steampunk\">steampunk</a> fiction, Gibson\'s fictional works have been hailed by space historian <a href=\"https://en.wikipedia.org/wiki/Dwayne_A._Day\">Dwayne A. Day</a> as some of the best examples of <a href=\"https://en.wikipedia.org/wiki/Outer_space\">space-based</a> science fiction (or \"solar sci-fi\"), and \"probably the only ones that rise above mere escapism to be truly thought-provoking\".</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->', 'WILLIAM GIBSON', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2022-10-03 15:32:43', '2022-10-03 15:32:43', '', 16, 'https://cbarnett4.bitlampsites.com/wpd/final/?p=281', 0, 'revision', '', 0),
