mined the way people thought and talked\" to an extent unprecedented in science fiction literature.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-mystic-131\">[130]</a></sup> The publication of <em>Neuromancer</em> (1984) hit a cultural nerve,<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-hollinger-38\">[37]</a></sup> causing <a href=\"https://en.wikipedia.org/wiki/Larry_McCaffery\">Larry McCaffery</a> to credit Gibson with virtually launching the <a href=\"https://en.wikipedia.org/wiki/Cyberpunk\">cyberpunk</a> movements.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->', 'WILLIAM GIBSON', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2022-10-03 15:37:46', '2022-10-03 15:37:46', '', 16, 'https://cbarnett4.bitlampsites.com/wpd/final/?p=283', 0, 'revision', '', 0),
