(290, 1, '2022-10-03 15:48:55', '2022-10-03 15:48:55', '<!-- wp:paragraph -->\n<p>\"Burning Chrome\" is a science fiction short story by Canadian-American writer William Gibson, first published in Omni in July 1982. Gibson first read the story at a science fiction convention in Denver, Colorado in the autumn of 1981, to an audience of four people, among them Bruce Sterling</p>\n<!-- /wp:paragraph -->', 'Burning Chrome', '', 'publish', 'closed', 'closed', '', 'burning-chrome', '', '', '2022-10-03 17:35:48', '2022-10-03 17:35:48', '', 0, 'https://cbarnett4.bitlampsites.com/wpd/final/?post_type=book&#038;p=290', 0, 'book', '', 0),
