(293, 1, '2022-10-03 15:50:52', '2022-10-03 15:50:52', '<!-- wp:paragraph -->\n<p>The millennium has come and gone, leaving in its wake only stunned survivors. In Los Angeles, Berry Rydell is a former armed-response rentacop now working for a bounty hunter. Chevette Washington is a bicycle messenger turned pickpocket who impulsively snatches a pair of innocent-looking sunglasses. But these are no ordinary shades. What you can see through these high-tech specs can make you rich—or get you killed. Now Berry and Chevette are on the run, zeroing in on the digitalized heart of DatAmerica, where pure information is the greatest high. And a mind can be a terrible thing to crash. . . .</p>\n<!-- /wp:paragraph -->', 'Virtual Light', '', 'publish', 'closed', 'closed', '', 'virtual-light', '', '', '2022-10-03 17:35:43', '2022-10-03 17:35:43', '', 0, 'https://cbarnett4.bitlampsites.com/wpd/final/?post_type=book&#038;p=293', 0, 'book', '', 0),
