\"has-large-font-size\">TOP BOOKS</h2>\n<!-- /wp:heading -->\n\n<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":291,\"sizeSlug\":\"large\",\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image size-large\"><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/burning-chrome/\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/burning.webp\" alt=\"\" class=\"wp-image-291\"/></a><figcaption><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/burning-chrome/\" data-type=\"book\" data-id=\"290\">Burning Chrome</a></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":284,\"sizeSlug\":\"large\",\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image size-large\"><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/count-zero/\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/22.webp\" alt=\"\" class=\"wp-image-284\"/></a><figcaption><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/count-zero/\" data-type=\"book\" data-id=\"160\">Count Zero</a></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":289,\"sizeSlug\":\"large\",\"linkDestination\":\"custom\"} -->\n<figure class=\"wp-block-image size-large\"><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/the-gernsback-continuum/\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/09/peripheral.webp\" alt=\"\" class=\"wp-image-289\"/></a><figcaption><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/the-gernsback-continuum/\" data-type=\"book\" data-id=\"157\">The Peripheral</a></figcaption></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:media-text {\"align\":\"\",\"mediaId\":279,\"mediaLink\":\"https://cbarnett4.bitlampsites.com/wpd/final/home/william_gibson_and_cory_doctorow/\",\"mediaType\":\"image\",\"mediaWidth\":38,\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-media-text is-stacked-on-mobile is-vertically-aligned-center\" style=\"grid-template-columns:38% auto\"><figure class=\"wp-block-media-text__media\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/William_Gibson_and_Cory_Doctorow.jpg\" alt=\"\" class=\"wp-image-279 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>CULTURAL SIGNIFICANCE</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>In his early short fiction, Gibson is credited by Rapatzikou in <em>The Literary Encyclopedia</em> with effectively \"renovating\" science fiction, a genre at that time considered widely \"insignificant\",<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-litencyc-9\">[9]</a></sup> influencing by means of the postmodern aesthetic of his writing the development of new perspectives in <a href=\"https://en.wikipedia.org/wiki/Science_fiction_studies\">science fiction studies</a>.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-hollinger-38\">[37]</a></sup> In the words of filmmaker Marianne Trench, Gibson\'s visions \"struck sparks in the real world\" and \"determined the way people thought and talked\" to an extent unprecedented in science fiction literature.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-mystic-131\">[130]</a></sup> The publication of <em>Neuromancer</em> (1984) hit a cultural nerve,<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-hollinger-38\">[37]</a></sup> causing <a href=\"https://en.wikipedia.org/wiki/Larry_McCaffery\">Larry McCaffery</a> to credit Gibson with virtually launching the <a href=\"https://en.wikipedia.org/wiki/Cyberpunk\">cyberpunk</a> movements.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->', 'WILLIAM GIBSON', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2022-10-03 16:26:43', '2022-10-03 16:26:43', '', 16, 'https://cbarnett4.bitlampsites.com/wpd/final/?p=306', 0, 'revision', '', 0),
