(314, 1, '2022-10-04 05:47:58', '2022-10-04 05:47:58', '<!-- wp:group -->\n<div class=\"wp-block-group\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"76%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:76%\"><!-- wp:heading {\"level\":1} -->\n<h1>WHO IS HE?</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>William Ford Gibson</strong> (born March 17, 1948) is an American-Canadian speculative<a href=\"https://en.wikipedia.org/wiki/Speculative_fiction\"> </a>fiction writer and essayist widely credited with pioneering the science fiction subgenre known as cyberpunk. Beginning his writing career in the late 1970s.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>his early works were noir, near-future stories that explored the effects of technology, cybernetics, and computer networks on humans—a \"combination of lowlife and high tech\".</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link\" href=\"https://cbarnett4.bitlampsites.com/wpd/final/bio/\">LEARN MORE</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"24%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:24%\"><!-- wp:image {\"align\":\"left\",\"id\":308,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image alignleft size-large\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/1518082872-william-gibson_6C9Gh-701x1024.jpg\" alt=\"\" class=\"wp-image-308\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:cover {\"customOverlayColor\":\"#804bf1\",\"align\":\"full\"} -->\n<div class=\"wp-block-cover 