"book\" data-id=\"157\">The Peripheral</a></figcaption></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:spacer {\"height\":\"10px\"} -->\n<div style=\"height:10px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link\">VIEW ALL</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:media-text {\"align\":\"\",\"mediaId\":279,\"mediaLink\":\"https://cbarnett4.bitlampsites.com/wpd/final/home/william_gibson_and_cory_doctorow/\",\"mediaType\":\"image\",\"mediaWidth\":38,\"verticalAlignment\":\"center\"} -->\n<div class=\"wp-block-media-text is-stacked-on-mobile is-vertically-aligned-center\" style=\"grid-template-columns:38% auto\"><figure class=\"wp-block-media-text__media\"><img src=\"https://cbarnett4.bitlampsites.com/wpd/final/wp-content/uploads/2022/10/William_Gibson_and_Cory_Doctorow.jpg\" alt=\"\" class=\"wp-image-279 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading -->\n<h2>CULTURAL SIGNIFICANCE</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>In his early short fiction, Gibson is credited by Rapatzikou in <em>The Literary Encyclopedia</em> with effectively \"renovating\" science fiction, a genre at that time considered widely \"insignificant\", influencing by means of the postmodern aesthetic of his writing the development of new perspectives in science fiction studies. In the words of filmmaker Marianne Trench, Gibson\'s visions \"struck sparks in the real world\" and \"determined the way people thought and talked\" to an extent unprecedented in science fiction literature.<sup><a href=\"https://en.wikipedia.org/wiki/William_Gibson#cite_note-mystic-131\"> </a></sup>The publication of <em><a href=\"https://cbarnett4.bitlampsites.com/wpd/final/book/neuromancer/\" data-type=\"book\" data-id=\"164\">Neuromancer</a></em> (1984) hit a cultural nerve, causing Larry McCaffery to credit Gibson with virtually launching the cyberpun<a href=\"https://en.wikipedia.org/wiki/Cyberpunk\">k</a> movements.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->', 'WILLIAM GIBSON', '', 'inherit', 'closed', 'closed', '', '16-revision-v1', '', '', '2022-10-05 04:12:03', '2022-10-05 04:12:03', '', 16, 'https://cbarnett4.bitlampsites.com/wpd/final/?p=340', 0, 'revision', '', 0),
